// navbarrr.js

import React from 'react';
import { View, Image, Text, StyleSheet, TouchableOpacity } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';

const Navbar = ({ onLogoutPress }) => {
  const handleIconPress = () => {
    console.log('Presionado el ícono de los tres puntos');
    onLogoutPress(); // Asegúrate de que esta línea esté aquí
  };

  return (
    <View style={[styles.navbar, styles.navbarWithMargin]}>
      <View style={styles.leftContainer}>
        <Image
          source={require('../assets/img/GIcon.png')}
          style={styles.logo}
          resizeMode="contain"
        />
        <Text style={styles.navbarText}>Tuiranfit</Text>
      </View>
      <TouchableOpacity onPress={handleIconPress}>
        <Icon name="ellipsis-v" size={20} color="white" style={styles.icon} />
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  navbar: {
    backgroundColor: 'black',
    padding: 10,
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between',
  },
  navbarWithMargin: {
    marginBottom: 20,
  },
  leftContainer: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  icon: {
    marginLeft: 10, // Ajusta la posición del ícono según sea necesario
  },
  logo: {
    width: 30,
    height: 30,
    marginRight: 10,
  },
  navbarText: {
    color: 'white',
    fontSize: 18,
    fontWeight: 'bold',
  },
});

export default Navbar;
